import { useState } from 'react';
import './App.css';


const App = () =>  {
  const [counter,setCounter] =  useState(0);
  return (
    <div className="App">
      <button onClick={()=> setCounter(counter)}>-</button>
      <h1>{counter}</h1>
      <button>+</button>
    </div>
  );
}

export default App;
